import React from "react";
import { FormControl } from "@material-ui/core";

const Form = () => {
  return (
    <div>
      <form>
        <FormControl
          id="standard-basic"
          label="Standard"
          defaultValue="Hello world"
        />
      </form>
    </div>
  );
};

export default Form;
